window.onload = function () {
    const savedArticle1 = sessionStorage.getItem('decryptedArticle1');
    if (savedArticle1) {
        document.getElementById('encrypted-text1').innerHTML = savedArticle1;
    }
    const savedArticle2 = sessionStorage.getItem('decryptedArticle2');
    if (savedArticle2) {
        document.getElementById('encrypted-text2').innerHTML = savedArticle2;
    }
    if (savedArticle1 && savedArticle2) {
        document.getElementById('password-gate').style.display = 'none';
    }
};

function decryptContent() {
    const encryptedText1 = '';
    const encryptedText2 = '';
    const password = document.getElementById('passwordInput').value;
    let decryptionFailed = false;

    const encryptedElement1 = document.getElementById('encrypted-text1');
    const encryptedElement2 = document.getElementById('encrypted-text2');
    try {
        const decryptedText1 = CryptoJS.AES.decrypt(encryptedText1, password).toString(CryptoJS.enc.Utf8);
        const decryptedText2 = CryptoJS.AES.decrypt(encryptedText2, password).toString(CryptoJS.enc.Utf8);

        if (decryptedText1) {
            encryptedElement1.innerHTML = decryptedText1;
            sessionStorage.setItem('decryptedArticle1', decryptedText1);
        } else {
            throw new Error("要素の復号に失敗しました。");
        }
        if (decryptedText2) {
            encryptedElement2.innerHTML = decryptedText2;
            sessionStorage.setItem('decryptedArticle2', decryptedText2);
        } else {
            throw new Error("要素の復号に失敗しました。");
        }
        document.getElementById('password-gate').style.display = 'none';
    } catch (e) {
        console.error(e);
        decryptionFailed = true;
    }

    if (decryptionFailed) {
        alert("パスワードが違うか、一部のコンテンツの復号に失敗しました。");
    }
}